import react from "react";
export const HelloPageContent: React.FC<{  }> = props => {
    return (
        <>
            <div className='bg-white w-auto h-auto grid  justify-items-center mx-auto my-auto p-10 rounded-3xl mx-auto'>
                <h1 className={"font-montserratBold text-xl mb-4"}>Добро пожаловать в Livrizon!</h1>
                <p className={'text-text-sec font-montserratRegular text-sm mb-4 w-max-84 flex text-center'}>Находи новые знакомства и возможности. Для тебя нет ничего невозможного</p>
                <input className={'w-full font-montserratRegular text-sm py-4 bg-secondary rounded-2xl pl-4 mb-4 outline-0'} placeholder={'Email или телефон'} />
                <input className={'w-full font-montserratRegular text-sm py-4 bg-secondary rounded-2xl pl-4 outline-0'} placeholder={'Пароль'} />
                <div className={'flex w-full mt-5'}>
                    <button className={'font-montserratRegular text-blue text-sm'}>Забыли пароль</button>
                    <button className={'ml-auto bg-black text-white rounded-1xl px-4 py-2'}>Продолжить</button>
                </div>
            </div>
        </>
    );
};
